class Solution:
    def subarraysDivByK(self, A, K):
        """
        :type A: List[int]
        :type K: int
        :rtype: int
        """
        from collections import defaultdict
        lookup = defaultdict(int)
        lookup[0] = 1
        if not A:
            return 0
        # print(len(A))
        dp = 0
        res = 0
        for num in A:
            dp += num
            res += lookup[dp%K]
            lookup[dp%K] += 1
        return res


